  false,\n\t\"url\": null,\n\t\"notes\": \"Moosehom National Wildlife Refuge (MNWR)
  includes the Moosehom Wilderness Area, which is a class I air quality zone administered
  by the U.S. Fish and Wildlife Service. As the land manager for the zone, US FWS
  has a responsibility to protect air and water quality in class I areas. In conjunction
  with Environmental Protection Agency Environmental Monitoring and Assessment Program
  (EMAP) in 1995, samples were collected and analyzed from three lakes in MNWR. Samples
  were collected during May, July, and October, representing the seasonal ranges for
  baseflow chemistry during the ice-free seasonin Maine. Because the Moosehom data
  were collected with the same methods as the EPA EMAP program, they can be interpreted
  in the general context of lake chemistry in Maine as inferred by EMAP.\",\n\t\"owner_org\":
